import React from 'react';
import { motion } from 'framer-motion';

const projectList = [
  { title: "E-Commerce App", category: "Web Development" },
  { title: "Fintech Platform", category: "Software Solution" },
  { title: "Health Tracker", category: "Mobile App" }
];

const Projects = () => {
  return (
    <div className="container">
      <span className="section-subtitle">Our Work [cite: 57]</span>
      <h2 style={{ fontSize: '3rem', marginBottom: '50px' }}>Featured Projects</h2>
      <div className="project-grid">
        {projectList.map((project, index) => (
          <motion.div 
            key={index} 
            className="project-card"
            whileHover={{ y: -10 }}
          >
            <div className="project-image-placeholder">
              {/* Image Address goes here */}
              <div className="project-overlay">
                <p>{project.category}</p>
                <h3>{project.title}</h3>
              </div>
            </div>
          </motion.div>
        ))}
      </div>
    </div>
  );
};

export default Projects;
